import React, { useState, useEffect, useContext } from "react";
import { Context as DataContext } from "../context/DataContext";

const Landing = () => {
  const { state, getData } = useContext(DataContext);
  const { data } = state;

  useEffect(() => {
    getData();
  }, []);

  return (
    <div className="">
      <div className="p-10 h-24 w-screen shadow-lg">Clayton Logo</div>
      <div className="p-10 grid grid-cols-1 md:grid-cols-3 gap-5">
        {data.map((item) => (
          <div key={item.homeName} className="shadow w-full flex flex-col">
            <img src={item.imageURL} className="" />
            <div className="flex flex-col">
              <h1>{item.homeName}</h1>
              <subtitle className="text-gray-400">
                Starting in the ${item.startingPrice}s
              </subtitle>
              <div>
                 {item.sqft} sq. ft {item.beds} beds {item.baths} baths {item.isMultiSection ? "Multi Section": null} 
              </div>
            </div>
          </div>
        ))}
      </div>
      <div> 
          <p>Copyright 2020 Clayton Homes.</p>
          <p>All Rights Reserved.</p>
          </div>
    </div>
  );
};

export default Landing;
